import React from 'react';
import classes from './GridCategory.module.css';
import { Row, Col, Container } from 'react-bootstrap';

import W1 from '../../assets/images/W1.png';
import W2 from '../../assets/images/W2.png';
import W3 from '../../assets/images/W3.png';
import W4 from '../../assets/images/W4.png';
import W5 from '../../assets/images/W5.png';
import W6 from '../../assets/images/W6.png';
import W7 from '../../assets/images/W7.png';
import W8 from '../../assets/images/W8.png';

function GridCategory() {
    return (

        <Container className={classes.GridContainerStyle}>
            <Container fluid>
                <Row >
                    <Col className={classes.GridCategoryStyle}>
                        <Row className={classes.GridCategoryStyle}><img src={W1} fluid /></Row>
                        <Row className={classes.GridCategoryStyle}><img src={W2} fluid /></Row>
                    </Col>

                    <Col className={classes.GridCategoryStyle}>
                        <Row>
                        <Col className={classes.GridCategoryStyle}><img src={W3} fluid /> </Col>
                        <Col className={classes.GridCategoryStyle}><img src={W4} fluid /> </Col>
                        </Row>
                    </Col>
                </Row>
            </Container>
            <Container className={classes.GridCategoryStyle} fluid>

                <Row>
                <Col className={classes.GridCategoryStyle}>
                        <Row>
                        <Col className={classes.GridCategoryStyle}><img src={W5} fluid /> </Col>
                        <Col className={classes.GridCategoryStyle}><img src={W6} fluid /> </Col>
                        </Row>
                    </Col>

                    <Col className={classes.GridCategoryStyle}>
                        <Row className={classes.GridCategoryStyle}><img src={W7} fluid /></Row>
                        <Row className={classes.GridCategoryStyle}><img src={W8} fluid /></Row>
                    </Col>


                </Row>
            </Container>
        </Container>
    )
}

export default GridCategory;
